(2, 'PNHS, sa re-enactment of the Battle of Legazpi', '<p style="text-align:justify"><span style="font-size:16px">PNHS, naimbitahang magtanghal ng re-enactment of the Battle of Legazpi</span></p>\r\n', '2014-01-23', 159, 'news/[2018-02-21][23-57-27]-1179958833.jpg', 'test', 'test'),
(4, 'PNHS, sa 8th Lakad at Tanim-Kahoy Para sa Puso', '<p style="text-align:justify"><span style="font-size:16px">PNHS, Isa sa may Pinakamaraming bilang ng mga Kalahok sa 8th Lakad at Tanim-Kahoy Para sa Puso</span></p>\r\n', '2014-02-14', 159, 'news/[2018-03-12][20-21-14]-2081865739.jpg', '', 'test'),
(14, 'PNHS Ranks first in division TAYO Awards', '<p style="margin-left:0in; margin-right:0in; text-align:justify"><span style="font-size:16px"><span style="font-family:Arial,Helvetica,sans-serif">True to its commitment to excellence, the Pag-asa for Environment in School Organization (PESO) won in the Division Search for Ten Accomplished Youth Organizations (TAYO) on September 15, 2016.</span></span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in; text-align:justify"><span style="font-size:16px"><span style="font-family:Arial,Helvetica,sans-serif">TAYO Awards is organized annually by the TAYO Awards Foundation Inc., in collaboration with the National Youth Commission (NYC), Coca-Cola Foundation and the Office of Senator Bam Aquino.</span></span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in; text-align:justify"><span style="font-size:16px"><span style="font-family:Arial,Helvetica,sans-serif">Aside from Pag-asa National High School, there were six other schools from the division of Legazpi which competed to bag the said award by presenting their organization&rsquo;s program in front of the panel of judges.</span></span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in; text-align:justify"><span style="font-size:16px"><span style="font-family:Arial,Helvetica,sans-serif">Represented by Zelvy G. Arao, the PESO president, PNHS ranked first on the search.</span></span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in; text-align:justify"><span style="font-size:16px"><span style="font-family:Arial,Helvetica,sans-serif">&ldquo;Winning this award wasn&rsquo;t just my success it was also the school&rsquo;s (success) since we all worked hard for it.&rdquo; Arao concluded.</span></span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in; text-align:justify">&nbsp;</p>\r\n', '2017-10-14', 10, 'news/[2018-03-14][08-15-26]-1710197413.jpg', 'test', 'April Cruz'),
(15, 'Salceda pledges gym to Pag-asa', '<p style="text-align:justify"><span style="font-size:16px">Albay Rep. Joey Salceda promised to put up an enclosed gymnasium next year.</span></p>\r\n\r\n<p style="text-align:justify"><span style="font-size:16px">This news was met with loud cheers from the crowd of students and teachers as the former governor accompanied Miss World Philippines 2016 Catriona Gray in the latter&rsquo;s visit on October 14, 2016.</span></p>\r\n\r\n<p style="text-align:justify"><span style="font-size:16px">&ldquo;Nakakaiyak. Andami&nbsp;ng blessings,&rdquo; said an emotional Angela Cross, a PNHS Senior high teacher as Salceda uttered his pledge to the school he calls &ldquo;the best high school in Legazpi City&rdquo;.</span></p>\r\n\r\n<p style="text-align:justify"><span style="font-size:16px">Salceda shared how proud he is of PNHS because of the school&rsquo;s efforts to improve the lives of its students, referring instances when the school was covered by national media because of its bike program, among others.</span></p>\r\n\r\n<p style="text-align:justify"><span style="font-size:16px">&ldquo;With that covered stadium, PNHS will no longer need to rent a venue elsewhere tohold huge events,&rdquo; said AP teacher Jeson Balingbing.</span></p>\r\n\r\n<p style="text-align:justify"><span style="font-size:16px">It was Salceda who made possible the homecoming of Catriona Gray.</span></p>\r\n', '2017-10-14', 159, 'news/[2018-02-22][10-27-22]-1864110575.jpg', 'sdfwrgrewget eragewtget', 'Judy Trilles'),
(19, 'Pag-asa represents PH in int''l ''hope'' fair', '<p style="text-align:justify"><span style="font-size:16px"><span style="background-color:#ffffff; color:#333333; font-family:Verdana,sans-serif">Pag-asa National High School (PNHS) represented the country in the recently held International Linkage Community (ILC) in Kuala Lumpur, Malaysia from September 24 to 28, 2016.Now on its second year, the ILC, with the goal of establishing a platform through which Southeast Asian students and educators can learn from one another, had its first Philippine delegation.</span></span></p>\r\n\r\n<p style="text-align:justify"><span style="font-size:16px"><span style="background-color:#ffffff; color:#333333; font-family:Verdana,sans-serif">&quot;It is an honor to have received the invitation.&quot; PNHS Principal Jeremy Cruz shared. The school caught the organizers&#39; attention when it was featured internationally for &#39;Bike Mo, Pag-asa Ko&#39; program. &quot;The fact that the organizers chose us from among thousands of other schools means something,&quot; Cruz added.&quot;This year&#39;s ILC was much more joyful and exciting because we have the Philippines, the most active and friendly delegation,&quot; said Nur Farahanna Binti Suid, one of the liaison officers assigned to the PNHS group.Other participating schools include Sekolah CikalSecondary and SMP Tunas Unggul, both from Indonesia, Hiroshima Perfectual Itsukaichi Senior High School from Japan, and King&#39;s College of Thailand. The group was comprised of school head Jeremy A. Cruz, assistant school head Teresita Biron, and ten students namely Ivan Lloyd Arania, Resylray Bien, Adrienne Mae Realingo, and Vera Mae Gaveria (10 - STEC), Cheene Jane Agao and Maria Luisa Cuevas (9 - STEC), George Philip Baronia from (9 - England), Aujel Orosco (8 - STEC) and Francis Guiriba and Romeo Manuel Bongais (7 - STEC). &quot;It felt surreal. In a short period, I learned so much about the culture of other countries from my co-participants. I made a lot of friends as well.&quot; On the first day, the 12 Filipino delegates got emotional and teary-eyed as they raised the Philippine Flag and sang the National Anthem, together with the other five countries. The second day saw various experiences for the PNHS contingent, as the twelve delegates were toured by the liaison officers around Craft Complex, showcasing the country&#39;s native handicrafts which they observed were similar to those made in the Philippines. They were also given a chance to visit the famous Petronas Twin Towers - one of the highest twin towers in the world. &quot;It was fun. We went to different tourist spots.&quot; Gaveria said. Competitions were then held on the third day. Resylray Bien participated in public speaking, Ivan Lloyd Arana in table tennis, and George Phillip Baronia and Aujel Orosco in chess. In the evening of that day, the PNHS students sang and danced to Tatlong Bibe, Sarong Banggui and Ray Valera&#39;s Anak. &quot;I felt really nervous during that time because it&#39;s my first time performing on an international stage, but after hearing other countries cheer and clap, my confidence built up,&quot; said Francis Guiriba. On the fourth day, each country had both exhibits showcasing the respective nation&#39;s culture. PNHS proudly presented the Filipino culture highlighting Bicolano products (which included pili nuts and sili keychains), as well as the landscape surrounding Mayon Volcano. The ten Pag-asa students also performed at the cultural Bicolano epic Ibalong.&quot;We will surely &#39;Gombak&#39; here in Gombak, Kuala Lumpur Malaysia,&quot; said Gaveria.</span></span></p>\r\n', '2016-09-24', 159, 'news/[2018-02-21][23-59-21]-1676812424.jpg', 'Pag-asa National High School (PNHS) represented the country in the recently held International Linkage Community (ILC) in Kuala Lumpur, Malaysia from September 24 to 28, 2016.', 'test');
