(18, 'To utilized instructional time to the fullest observing the 180-day non-negotiatable contact time with students', '5', 6, 'June 2016-March 2017', 0),
(19, 'To prepare daily lesson logs/plans based on Tg and CG following the format stipulated in DepEd Order No. 42, s. 2016', '5', 6, 'June 2016-March 2017', 0),
(20, 'To make sure that the classroom is safe and conducive to learning', '5', 7, 'June 2016-March 2017', 0),
(21, 'To create an environment that promotes fairness, peace and harmony', '5', 7, 'June 2016-March 2017', 0),
